/** @format */

import styled from "styled-components";

function Header() {
  return (
    <HeaderWrapper>
      <Logo>
        <a>
          <img src="./images/logo.svg" alt="Tesla Logo"></img>
        </a>
      </Logo>
      <Menu>
        <a href="#">Model S</a>

        <a href="#">Model 3</a>

        <a href="#"> Model X</a>

        <a href="#">Model Y</a>

        <a href="#">Solar Roof</a>

        <a href="#">Solar Panles</a>
      </Menu>
      <RightMenu>
        <a>Shop</a>
        <a>Account</a>
        <a>Menu</a>
      </RightMenu>
    </HeaderWrapper>
  );
}

export default Header;

const Logo = styled.div`
  display: inline-block;
  cursor: pointer;
`;

const HeaderWrapper = styled.div`
  min-height: 60px;
  position: fixed; //sticky header
  display: flex;
  align-items: center;
  padding: 0 20px;
  top: 0;
  left: 0;
  right: 0;
`;

const Menu = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  // background-color: grey;
  flex: 1;

  @media (max-width: 865px) {
    display: none;
  }

  a {
    font-weight: 600;
    transform: scale(1.2);
    text-transform: Uppercase;
    padding: 0 20px;
    flex-shrink: 0;
  }
`;

const RightMenu = styled.div`
  margin-left: 20px;

  @media (max-width: 1138px) {
    display: none;
  }

  a {
    font-weight: 600;
    transform: scale(1.2);
    text-transform: Uppercase;
    margin-right: 10px;
    flex-shrink: 0;
    padding: 20px;
  }
`;
